column8:
従来のＡＴ～最新式の電子制御トルコン付７速ＡＴまで対応。　<BR>
<BR>
■マニュアルモード付きＡＴ<BR>
■オートマチックトランスアクスル<BR>
■耐ジャダ-性能が要求されるロックアップクラッチ付ＡＴ（μ-V特性）<BR>
■ハイブリッド車用ＡＴ　などにも無理なくご使用頂けます。<BR>
<BR>  
※2006年12月末をもって、世界的に全てのDEXRON-〓(H)MERCON ATFがライセンス切れを迎えました。<BR>
そこで、ケンドルでは製品名を[CLASSIC ATF]に変更する事になりました。<BR> 
中・大型のトラック、バスＡＴにも最適。最大手ＧＭ／Allisonの技術承認も取得。 <BR>
※GM社（アリソン事業部）は世界の中・大型商用車ATで約90％のシェアを保有しています。  <BR>
下記の国内トラック、バスメーカーの中・大型商用車ＡＴにも使用できます。　　<BR>
（例）イスズ、日産ディーゼル、日野、三菱ふそう　他<BR>
・国産のみならず、高級外国車のＡＴにも無理なく対応。<BR>
（例）BMW, メルセデスベンツ、アウディ、オペル、ＶＷ、サーブ、ローバー、サターン、プジョー、シトロエン、ボルボ、ポルシェ、フィアット、ルノー、フェラーリ、ジャガー、ＧＭ、フォード、クライスラー他
<BR>   
・乗用車から中・大型車までの油圧式パワーステアリングまで対応。<BR>
大型車の苛酷な油圧条件にも耐えうる優れた耐摩耗性油圧作動油でもあります。<BR>
JASO　２種２号（過酷な条件）もクリア。<BR>  
   <BR>
・エンジン排気量２０００cc 以上の金属ベルト式ＣＶＴシステムで差が出る！<BR>
ご存知でしたか？<BR>
海外でも多くの自動車メーカーがＣＶＴを採用しています。<BR>
（例）BMW, フィアット、GM、現代、起亜、ランチャ、ＭＧ、オペル、ローバー　ほか<BR>
<br>
※写真はイメージです。<br>
